# 2. 解析

## 方法一：滑动窗口

### 思路

使用滑动窗口（双指针）来维护当前不含重复字符的子串。具体步骤如下：

1. **初始化**：使用两个指针 `left` 和 `right` 表示当前窗口的左右边界，初始时都指向字符串的开头。
2. **移动右指针**：`right` 指针向右移动，每次将当前字符加入窗口。
3. **检查重复**：使用一个集合（`unordered_set`）来记录当前窗口中的字符。如果 `right` 指针指向的字符在集合中已存在，说明出现了重复字符。
4. **移动左指针**：当出现重复字符时，移动 `left` 指针，直到窗口中不再有重复字符。同时，从集合中移除 `left` 指针经过的字符。
5. **更新最大长度**：在每次移动 `right` 指针后，计算当前窗口的长度（`right - left`），并更新最大长度。

### 复杂度分析

- **时间复杂度**：O(n)，其中 n 是字符串的长度。每个字符最多被访问两次（一次被 `right` 指针加入窗口，一次被 `left` 指针移出窗口）。
- **空间复杂度**：O(min(m, n))，其中 m 是字符集的大小（ASCII 字符集最多 128 个字符）。在最坏情况下，整个字符串都是不重复的字符，集合的大小为 n。

### 代码

```cpp
#include <unordered_set>
#include <string>
using namespace std;

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        unordered_set<char> charSet;
        int left = 0;
        int maxLength = 0;

        for (int right = 0; right < s.size(); ++right) {
            while (charSet.find(s[right]) != charSet.end()) {
                charSet.erase(s[left]);
                ++left;
            }
            charSet.insert(s[right]);
            maxLength = max(maxLength, right - left + 1);
        }

        return maxLength;
    }
};
```

