var nextGreaterElement = function(nums1, nums2) {
    // 使用单调栈预处理nums2
    let stack = [];
    let map = new Map(); // 存储每个元素的下一个更大元素

    // 遍历nums2
    for (let num of nums2) {
        // 当栈不为空且当前元素大于栈顶元素时，说明当前元素是栈顶元素的下一个更大元素
        while (stack.length > 0 && num > stack[stack.length - 1]) {
            map.set(stack.pop(), num);
        }
        // 当前元素入栈
        stack.push(num);
    }

    // 栈中剩余元素没有下一个更大元素，在map中设为-1
    while (stack.length > 0) {
        map.set(stack.pop(), -1);
    }

    // 遍历nums1，从map中取结果
    let result = [];
    for (let num of nums1) {
        result.push(map.get(num));
    }

    return result;
};

