// 1. 题目描述：给定一个整数数组 nums 和一个整数 k，返回该数组所有长度为 k 的子数组中的最大值。
// 2. 要求：设计一个时间复杂度为 O(n) 的算法。
// 3. 示例：输入: nums = [1,3,-1,-3,5,3,6,7], k = 3，输出: [3,3,5,5,6,7]

// 使用双端队列（deque）来实现单调队列
function maxSlidingWindow(nums, k) {
    if (!nums.length || k === 0) return [];
    if (k === 1) return nums;

    const deque = []; // 存储索引，队列头部始终是当前窗口最大值的索引
    const result = [];

    // 初始化第一个窗口
    for (let i = 0; i < k; i++) {
        // 维护队列单调递减：从队尾开始，移除所有小于当前元素的元素索引
        while (deque.length && nums[i] >= nums[deque[deque.length - 1]]) {
            deque.pop();
        }
        deque.push(i);
    }
    result.push(nums[deque[0]]);

    // 从第k个元素开始遍历
    for (let i = k; i < nums.length; i++) {
        // 如果队首元素不在当前窗口内（即索引小于等于i-k），则移除
        if (deque[0] <= i - k) {
            deque.shift();
        }

        // 同样维护队列单调递减
        while (deque.length && nums[i] >= nums[deque[deque.length - 1]]) {
            deque.pop();
        }
        deque.push(i);

        // 当前窗口的最大值在队首
        result.push(nums[deque[0]]);
    }

    return result;
}

// 测试示例
const nums = [1,3,-1,-3,5,3,6,7];
const k = 3;
console.log(maxSlidingWindow(nums, k)); // 输出: [3,3,5,5,6,7]
