# 1. Introduction

In the ever-evolving landscape of web development, creating efficient and scalable applications is paramount. NestJS, a progressive Node.js framework, has gained popularity for its modular architecture and TypeScript support. One of the key features that make NestJS powerful is its dependency injection system, which allows for the creation of loosely coupled and easily testable components. In this article, we'll explore how to leverage dependency injection in NestJS to build robust and maintainable applications.

## 2. Understanding Dependency Injection

Dependency Injection (DI) is a design pattern where the dependencies of a class are provided from the outside rather than created within the class itself. This promotes decoupling and makes the code more modular and testable. In NestJS, the DI system is built-in and heavily inspired by Angular.

### 2.1. Basic Concepts

- **Provider**: A provider is a class that can be injected into other classes. Providers are decorated with `@Injectable()`.
- **Module**: A module is a class annotated with `@Module()` that organizes providers and other related components.
- **Injector**: The NestJS runtime system that manages the creation and injection of dependencies.

## 3. Setting Up a NestJS Project

Before diving into dependency injection, let's set up a basic NestJS project. If you haven't already, install the Nest CLI globally:

```bash
npm install -g @nestjs/cli
```

Create a new project:

```bash
nest new dependency-injection-demo
cd dependency-injection-demo
```

## 4. Creating Injectable Services

Services in NestJS are typically where business logic resides. They are decorated with `@Injectable()` to make them injectable.

### 4.1. Creating a Simple Service

Generate a new service:

```bash
nest generate service users
```

This creates `users.service.ts`:

```typescript
import { Injectable } from '@nestjs/common';

@Injectable()
export class UsersService {
  private users = [
    { id: 1, name: 'John Doe' },
    { id: 2, name: 'Jane Doe' },
  ];

  findAll() {
    return this.users;
  }

  findOne(id: number) {
    return this.users.find(user => user.id === id);
  }
}
```

## 5. Injecting Dependencies into Controllers

Controllers handle incoming requests and return responses. They can inject services to delegate business logic.

### 5.1. Creating a Controller

Generate a controller:

```bash
nest generate controller users
```

This creates `users.controller.ts`:

```typescript
import { Controller, Get, Param } from '@nestjs/common';
import { UsersService } from './users.service';

@Controller('users')
export class UsersController {
  constructor(private readonly usersService: UsersService) {}

  @Get()
  findAll() {
    return this.usersService.findAll();
  }

  @Get(':id')
  findOne(@Param('id') id: string) {
    return this.usersService.findOne(+id);
  }
}
```

Notice how `UsersService` is injected into the controller's constructor. NestJS takes care of providing an instance of `UsersService` when creating `UsersController`.

## 6. Module Organization

Modules in NestJS are used to organize the application structure. Each module can import other modules and declare its providers and controllers.

### 6.1. The App Module

The root module is `app.module.ts`:

```typescript
import { Module } from '@nestjs/common';
import { UsersController } from './users/users.controller';
import { UsersService } from './users/users.service';

@Module({
  imports: [],
  controllers: [UsersController],
  providers: [UsersService],
})
export class AppModule {}
```

Here, `UsersService` is provided at the module level, making it available to all controllers within the module.

## 7. Custom Providers

Sometimes you need more control over how providers are created. NestJS allows defining custom providers.

### 7.1. Value Providers

You can provide a constant value:

```typescript
import { Module } from '@nestjs/common';

@Module({
  providers: [
    {
      provide: 'API_KEY',
      useValue: 'secret-key-123',
    },
  ],
})
export class AppModule {}
```

